import { authHeader } from "../_helpers";
import axios from "axios";
import { params } from "../_helpers";
export const userService = {
  getUser,
  updateUser,
  getBalance,
  transfer,
  getcountries
};

function getUser() {
  const header = { "headers":authHeader()}
  return axios.get(`${params.APIURL}/user`,header).then( res => res.data)
}

